const geminiResponse = firstItem.json;

// --- Collect text from Gemini (join all parts) ---
function getTextFromGemini(obj) {
  const parts =
    obj?.candidates?.[0]?.content?.parts ??
    obj?.content?.parts ??
    [];
  if (Array.isArray(parts) && parts.length) {
    return parts.map(p => (typeof p?.text === 'string' ? p.text : '')).join('\n');
  }
  return obj?.output_text ?? obj?.text ?? '';
}

let raw = getTextFromGemini(geminiResponse);

// --- Normalize & clean wrappers ---
let cleaned = String(raw)
  .replace(/```(?:json|JSON)?/g, '')      // strip ```json fences
  .replace(/[â€œâ€]/g, '"')                  // smart quotes -> normal
  .replace(/[â€˜â€™]/g, "'")
  .replace(/^\s*(?:json|JSON)\s*(?=[\[{])/m, '') // remove leading 'json' label
  .trim();

// --- Extract first JSON object/array by balanced brackets (handles extra prose) ---
function extractFirstJsonBlock(s) {
  const openers = ['{', '['];
  const closers = { '{': '}', '[': ']' };
  let start = -1, stack = [];
  let inStr = false, esc = false, quote = null;

  for (let i = 0; i < s.length; i++) {
    const ch = s[i];

    if (inStr) {
      if (esc) { esc = false; continue; }
      if (ch === '\\') { esc = true; continue; }
      if (ch === quote) { inStr = false; quote = null; continue; }
      continue;
    } else {
      if (ch === '"' || ch === "'") { inStr = true; quote = ch; continue; }
      if (openers.includes(ch)) {
        if (start === -1) start = i;
        stack.push(ch);
        continue;
      }
      if (stack.length && ch === closers[stack[stack.length - 1]]) {
        stack.pop();
        if (!stack.length) {
          return s.slice(start, i + 1);
        }
      }
    }
  }
  return null;
}

const jsonCandidate = extractFirstJsonBlock(cleaned);
if (!jsonCandidate) {
  throw new Error(`No JSON block found in response.\nPreview:\n${cleaned.slice(0, 400)}`);
}

// --- Parse JSON safely ---
let parsed;
try {
  parsed = JSON.parse(jsonCandidate);
} catch (err) {
  throw new Error(`Failed to parse JSON: ${err.message}\nCandidate:\n${jsonCandidate}`);
}

// --- Support array/object & alternate key names ---
let src = Array.isArray(parsed) ? (parsed[0] ?? {}) : parsed;
if (src?.job_details) src = src.job_details;

const score =
  src.Score ?? src['Match Score'] ?? src.score ?? src.matchScore ?? 0;
const strengths = src.Strengths ?? src.strengths ?? [];
const gaps = src.Gaps ?? src.gaps ?? [];

// --- Debug logs (visible in n8n execution) ---
console.log('Score:', score);
console.log('Strengths:', strengths);
console.log('Gaps:', gaps);

// --- Return structured output ---
return [{ json: { score, strengths, gaps } }];

